import './App.css';
import HomeImg from './Images/home.svg';


function App() {
  return (
    <div className="App">
      <div className='TopBar'>
        <button className='Menu'><div><img></img></div></button>
        <img className='logo'></img>
        {/* TopBar Left btns  */}
        <button className='Search'><img></img></button>
        <button className='Cast'><img></img></button>
        <button className='Profile'><img></img></button>
      </div>

      <div className='LeftBar'>
        <button className='Home'><img src={HomeImg}></img>Home</button>
        <button className='Explore'><img></img>Explore</button>
        <button className='Library'><img></img>Library</button>
      </div>
    </div>
  );
}

export default App;
